import React from "react";
import { styled } from "@mui/material/styles";
import { Grid } from "@mui/material";
import Box from "@mui/material";

const Register = () => {
  return (
    <Box>
      <Grid container>
        <Grid></Grid>
      </Grid>
    </Box>
  );
};

export default Register;
